script: |
  super -f text -I q9435.spq | sort > q9435.out

inputs:
  - name: q9435.spq
    data: |
      SELECT ALL 77 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT col2 IN ( + 47 + - col0, 12, 20 * - - col0 * + col0 );
  - name: tab1

outputs:
  - name: q9435.out
    data: |
      77
      77
      77
